import React from 'react';
import './produucts.css'
import dom from './dom.png';

function Home4() {
  return (
    <div className='home'>
      <div className='home2'>
      <div>Горячие предложения</div>
      <div className='home3'>
        <div>
          <img src={dom} alt='dom' className='dom'></img>/</div>
          <div className='home5'>Горячие предложения</div>
      </div>
    </div>
    </div>
  );
}

export default Home4;
